  }

  render() {

    return (
      <div className='App'>
        <header className="App-header">
          <h1> Speeday </h1>
        </header>

        <div className="Tasks">
          <div className="TaskWriter">
            <TaskCreator />
          </div>
          <div className="TaskList"><div className="mb-4">
            <button onClick={this.submitTasks}>
              Submit Tasks
            </button>
          </div>
            <TaskList></TaskList>
          </div>

        </div>
      </div >



    );
  }
}

export default App;
